import React from 'react'

function ContentPart(props) {
    const x=props.values;
    let val;
    if(x=="About"){
        val=(<div>
            <h1></h1>
        </div>);
    }
  return (
    <div className='bodypart'>
      {props.values}
      {x}
    </div>
  )
}

export default ContentPart
